"use strict";

function f_gold(encodedText, rows) {
    let ans = [];
    let cols = Math.floor(encodedText.length / rows);
    for (let j = 0; j < cols; j++) {
        let x = 0, y = j;
        while (x < rows && y < cols) {
            ans.push(encodedText[x * cols + y]);
            x++, y++;
        }
    }
    return ans.join('').trim();
}
